import React from 'react';
import { Pie } from "react-chartjs-2";
import { MDBContainer } from "mdbreact";

const getUnqiue = (object, key) => {
  console.log(object);
  console.log(key);
  console.log(object[0].key)
}

const Types = (props) => {

  getUnqiue(props.beer, 'name');

  const labels = ["IPA", "Sour Ale", "Saison", "Stout", "Porter"];
  const data = [11, 11, 11, 11, 11];
  const colors = [
    "red",
    "blue",
    "yellow",
    "green",
    "brown",
  ];

  const asdf = {
    dataPie: {
      labels: labels,
      datasets: [
        {
          data: data,
          backgroundColor: colors,
          hoverBackgroundColor: colors
        }
      ]
    }
  }

  return (
    <MDBContainer>
      <h3 className="mt-5">Country of Origin</h3>
      <Pie data={asdf.dataPie} options={{ responsive: true }} />
    </MDBContainer>
  )
}

export default (Types);
